import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import './Navbar.css';
const NavigationBar = () => {
  return (
    <Navbar collapseOnSelect expand="md" bg="secondary" variant="dark" className='container'>

      <Container>  
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">

        <Nav class="nav-top">
          <Nav.Link as={Link} to="/Calc">CALCULATRICE</Nav.Link> 
          <Nav.Link as={Link} to="/Slider">SLIDER</Nav.Link>
          <Nav.Link as={Link} to="/ToDoList">TO DO LIST</Nav.Link>
          <Nav.Link as={Link} to="/API">PAGINATION</Nav.Link>
          <Nav.Link as={Link} to="/context/Langcontext">MULTILANGUAGE</Nav.Link>
          <Nav.Link as={Link} to="*">AUTRE</Nav.Link>
        </Nav>
        </Navbar.Collapse>
      </Container>   
    </Navbar>
  );
};

export default NavigationBar;
